import React from 'react';
import './MoneyCounting.style.scss';
import PageBase from '../../../utilities/PageBase/PageBase';
import { withCookies } from 'react-cookie';
import QrReader from 'react-qr-reader';
import { Row, Col, Empty, notification, Button, Tooltip } from 'antd';
import { ReloadOutlined, ShoppingCartOutlined } from '@ant-design/icons';
import NumberFormat from 'react-number-format';

class MoneyCounting extends PageBase {
  constructor(props) {
    super(props);
    this.state = {
      scannedProduct: null
    }
  }

  openNotificationWithIcon = (type, message, description) => {
    notification[type]({
      message,
      description
    });
  };

  handleScan = data => {
    if (data) {
      this.openNotificationWithIcon('success', 'Đã tìm thấy sản phẩm', '')
      this.setState({
        scannedProduct: JSON.parse(data)
      })
    }
  }

  handleError = error => {
    if (error) {
      this.openNotificationWithIcon('error', 'Chưa tìm thấy sản phẩm', '');
    }
  }

  render() {
    const { scannedProduct } = this.state;

    return (
      <div className="money-counting">
        <div className="money-counting__panel">
          <Row>
            <Col span={7}>
              <div className="money-counting__panel__left">
                <div className="money-counting__panel__left__product-scanning">
                  <QrReader
                    delay={300}
                    onError={error => this.handleError(error)}
                    onScan={data => this.handleScan(data)}
                    className="money-counting__panel__left__product-scanning__scanner"
                  />
                </div>
                <div className="money-counting__panel__left__product-details">
                  <Row align="middle">
                    <Col span={22}><h3>Thông tin sản phẩm</h3></Col>
                    <Col span={2} align="center">
                      <Tooltip title="Làm mới" placement="bottom">
                        <Button shape="circle" icon={<ReloadOutlined />}
                          className="money-counting__panel__left__product-details__btn-clear" />
                      </Tooltip>
                    </Col>
                  </Row>
                  {scannedProduct ? (
                    <Row gutter={20}>
                      <Col span={8}>
                        <ul className="money-counting__panel__left__product-details__labels">
                          <li>Tên sản phẩm</li>
                          <li>Giá bán</li>
                          <li>Nhà phân phối</li>
                        </ul>
                      </Col>
                      <Col span={16}>
                        <ul className="money-counting__panel__left__product-details__texts">
                          <li>{scannedProduct.name}</li>
                          <li>
                            <NumberFormat
                              value={scannedProduct.price}
                              displayType="text"
                              thousandSeparator={true}
                              suffix=" VNĐ"
                              style={{ fontWeight: 'bold' }} />
                          </li>
                          <li>{scannedProduct.supplier.name}</li>
                        </ul>
                      </Col>
                    </Row>
                  ) : (<Empty description="Chưa tìm thấy" className="money-counting__panel__left__product-details__empty" />)}
                </div>
              </div>
            </Col>
            <Col span={17}>
              <div className="money-counting__panel__right">
                <div className="money-counting__panel__right__topbar">
                  <Row>
                    <Col span={20}>
                      <h3 className="money-counting__panel__right__topbar__title">
                        <div className="money-counting__panel__right__topbar__title__icon-wrapper">
                          <ShoppingCartOutlined className="money-counting__panel__right__topbar__title__icon-wrapper__icon" />
                        </div>
                        <span>Giỏ hàng của khách</span>
                      </h3>
                    </Col>
                    <Col span={4}>
                      <div className="money-counting__panel__right__topbar__btn-submit-done">
                        <Button type="primary">Hoàn tất giao dịch</Button>
                      </div>
                    </Col>
                  </Row>
                </div>
                <div className="money-counting__panel__right__shopping-cart"></div>
                <div className="money-counting__panel__right__toolbar"></div>
              </div>
            </Col>
          </Row>
        </div>

      </div>
    )
  }
}
export default withCookies(MoneyCounting)
